import React from 'react'

function KeyBoard() {
    const KeyBoard = [
        [1,2,3],
        [4,5,6],
        [7,8,9]
    ]

    return (
    <div className='keyboard'>
        {
            KeyBoard.map( row => (
                <div className='row-container'>
               {
                    row.forEach( key =>{
                            <span className='keyboard--key'>{key}</span>                    
                        })
                    }
             </div>
            ))
        }
    </div>
  )
}

export default KeyBoard
